Welcome to the House Buffet Podcast,

our idea is to support Newcomers and mix em up with also known and popular DJs.
For this purpose we established a podcast with a wide range from Deep via Melodic / Summer House up to Techhouse music.

Our goal is not to publish every week a Top 100 DJ after another, instead we want to mix also lesser known DJs inbetween already more popular DJ adresses, to support lesser known DJs & producers and give em a platform. True to the motto once everyone starts out small and has in our opinion deserved a chance to get more popular.

Between these Podcasts we try to keep you up to date with some Summer and Deep House Tunes from also known and unknown producers.

We are always searching for great new music and artists to bring them to the people, whereat it's not important if you have thousands of followers or 100 -> Music is the key. So if you are interested in doing a podcast for us, feel free to contact us. If we like what you do, we might have a free slot for you. We try to answer every inquiry! Sound should fit into the postings of course ;)

If you are a copyright owner and want your work to be removed from our channel please contact us with a personal message here and we will remove your material right away. Please note that we do not benefit from posting this material and have only the intention to help new and emerging artist to be heard by supporting & promoting podcasts.

So we will hope you enjoy this channel!

